"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"swe","metadata":{"permalink":"/blog/swe","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-27-SWE/index.md","source":"@site/blog/2022-12-27-SWE/index.md","title":"SWE(Shallow Water Equations)","description":"SWE","date":"2022-12-27T00:00:00.000Z","formattedDate":"December 27, 2022","tags":[{"label":"swe","permalink":"/blog/tags/swe"},{"label":"hydraulics","permalink":"/blog/tags/hydraulics"}],"readingTime":6.475,"hasTruncateMarker":false,"authors":[{"name":"\uae40\uc885\ud601","title":"Undergraduate Student","url":"https://enfycius.github.io","imageURL":"https://avatars.githubusercontent.com/u/34566999?v=4","key":"jong"}],"frontMatter":{"slug":"swe","title":"SWE(Shallow Water Equations)","authors":["jong"],"tags":["swe","hydraulics"]},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"![SWE](https://upload.wikimedia.org/wikipedia/commons/3/37/Shallow_water_waves.gif)\\n\\nShallow-Water Equations (SWE)\ub294 \uc5b4\ub5a4 \uc720\uccb4\uc5d0\uc11c \uc555\ub825\ud45c\uba74(\ubc18\ub4dc\uc2dc\ub294 \uc544\ub2c8\ub098, \ub54c\ub54c\ub85c \uc790\uc720\uc218\uba74\uc744 \ub73b\ud55c\ub2e4.) \uc544\ub798\uc758 \ud750\ub984\uc744 \uc124\uba85\ud558\ub294 \uc30d\uace1\uc120 \ud3b8\ubbf8\ubd84 \ubc29\uc815\uc2dd\uc758 \uc9d1\ud569\uc774\ub2e4. (\ub9cc\uc57d \uc810\uc131\uc5d0 \uc758\ud55c \uc804\ub2e8\ub825\uc774 \uace0\ub824\ub41c\ub2e4\uba74 \ud3ec\ubb3c\uc120 \ud3b8\ubbf8\ubd84 \ubc29\uc815\uc2dd\uc774 \ub41c\ub2e4.)\\n\\n\ub2e8\uc77c \ubc29\ud5a5\uc758 \ud615\ud0dc\uc5d0\uc11c SWE\ub294 \uc18c\uc704 Saint-Venant \ubc29\uc815\uc2dd\uc73c\ub85c \ubd88\ub9b0\ub2e4.\\n\\n\uc774\ub7ec\ud55c Saint-Venant \ubc29\uc815\uc2dd\uc740 Navier-Stokes \ubc29\uc815\uc2dd\uc744 \uc218\uc2ec(depth)\uc5d0 \ub300\ud574 \uc801\ubd84\ud568\uc73c\ub85c\uc368 \uc720\ub3c4\ud560 \uc218 \uc788\ub294\ub370, \uc774 \uacbd\uc6b0 \uc218\ud3c9 \uae38\uc774\uc758 \uc2a4\ucf00\uc77c(scale)\uc774 \uc5f0\uc9c1 \uae38\uc774\uc758 \uc2a4\ucf00\uc77c(scale)\uc5d0 \ube44\ud574 \ud6e8\uc52c \ub354 \ud06c\ub2e4.\\n\\n\uc774\ub7ec\ud55c \uc870\uac74 \ud558\uc5d0\uc11c \uc9c8\ub7c9\uc758 \ubcf4\uc874\uc740 \uc5f0\uc9c1 \ubc29\ud5a5\uc73c\ub85c\uc758 \uc720\uc18d\uc5d0 \ub300\ud55c \uc2a4\ucf00\uc77c\uc774 \uc218\ud3c9\uc5d0 \ube44\ud574 \uc791\ub2e4\ub294 \uac83\uc744 \uc758\ubbf8\ud55c\ub2e4.\\n\\n:::success\\n\uc608\ub97c \ub4e4\uc5b4, \uc5b4\ub5a4 \ud1b5\uc218\ub2e8\uba74\uc774 \ub2e8\uc704\ud3ed\uc744 \uc9c0\ub2cc\ub2e4\uace0 \uac00\uc815\ud574\ubcf4\uc790.\\n\\n\uc218\ud3c9\ubc29\ud5a5\uc73c\ub85c\uc758 \ud1b5\uc218\ub2e8\uba74\uc801\uc744 $$A_{h}$$\ub77c \ud558\uace0, \uc5f0\uc9c1\ubc29\ud5a5\uc73c\ub85c\uc758 \ud1b5\uc218\ub2e8\uba74\uc801\uc744 $$A_{v}$$\ub77c \ud558\uba74, \ud1b5\uc218\ub2e8\uba74\uc774 \ub2e8\uc704\ud3ed\uc744 \uc9c0\ub2c8\uace0 \uc788\uae30 \ub54c\ubb38\uc5d0 $$A_{h} = 1 \\\\times h_{h}$$\uc774\uace0, $$A_{v} = 1 \\\\times h_{v}$$\uc774\ub2e4.\\n\\n\uadf8\ub7f0\ub370 \uc55e\uc11c \uc218\ud3c9 \uae38\uc774\uc758 \uc2a4\ucf00\uc77c\uc774 \uc5f0\uc9c1 \uae38\uc774\uc758 \uc2a4\ucf00\uc77c\uc5d0 \ube44\ud574 \ud6e8\uc2e0 \ub354 \ud06c\ub2e4\uace0 \ud588\uc73c\ubbc0\ub85c, \uc989 $$h_{h} \\\\gg h_{v}$$\uc774\ubbc0\ub85c, $$A_{h} \\\\gg A_{v}$$\ub97c \ub9cc\uc871\ud55c\ub2e4.\\n\\n\uae30\ubcf8\uc801\uc73c\ub85c, \uc9c8\ub7c9\ubcf4\uc874\uc758 \ubc95\uce59\uc740 \ud56d\uc0c1 \uc131\ub9bd\ud558\uace0, 1\ucc28\uc6d0 \uc5f0\uc18d\ubc29\uc815\uc2dd\uc740 $$Q=AV$$\uc774\ubbc0\ub85c, $$Q$$\uac00 \uc77c\uc815\ud55c \uc0c1\ud669\uc5d0\uc11c \ub2e8\uba74\uc801 $$A$$\uc640 \uc720\uc18d $$V$$\ub294 \ubc18\ube44\ub840 \uad00\uacc4\uc5d0 \ub193\uc774\uac8c \ub418\uc5b4 \uacb0\ub860\uc801\uc73c\ub85c $$V_{v} > V_{h}$$\uc758 \uad00\uacc4\uac00 \uc131\ub9bd\ud558\uac8c \ub41c\ub2e4.\\n:::\\n\\n\uc5f0\uc9c1 \uc555\ub825 gradient\uac00 \uac70\uc758 \uc815\uc218\uc555\uc5d0 \uac00\uae4c\uc6b0\uba70 \uc218\ud3c9 \uc555\ub825 gradient\ub294 \uc555\ub825\ud45c\uba74\uc758 \ubcc0\uc704\ub85c \uc778\ud574 \ubc1c\uc0dd\ud568\uc744 \uc54c \uc218 \uc788\uc73c\uba70, \uc774\ub294 \uc218\ud3c9 \uc18d\ub3c4\uc7a5\uc774 \uc720\uccb4\uc758 \uc218\uc2ec \uc804\uccb4\uc5d0 \uac78\uccd0 \uc77c\uc815\ud558\ub2e4\ub294 \uac83\uc744 \uc758\ubbf8\ud55c\ub2e4.\\n\\n\uc5f0\uc9c1\uc73c\ub85c \uc801\ubd84\ud558\ub294 \uac83\uc740 \uc5f0\uc9c1\ubc29\ud5a5\uc758 \uc720\uc18d\uc774 \ud574\ub2f9 \ubc29\uc815\uc2dd\uc73c\ub85c\ubd80\ud130 \uc81c\uac70\ub418\ub3c4\ub85d \ud574\uc900\ub2e4.\\n\\n:::warning\\n\uc815\uc801\ubd84\uc5d0\uc11c \uc18c\uac70\ud558\uace0 \uc2f6\uc740 \ubcc0\uc218\uc5d0 \ub300\ud558\uc5ec \uc801\ubd84\uc744 \uc9c4\ud589\ud558\uac8c \ub418\uba74, \uc801\ubd84\uc758 \uacb0\uacfc \uc2dd\uc5d0\uc11c \ud574\ub2f9 \ubcc0\uc218\uac00 \ub4dc\ub7ec\ub098\uc9c0 \uc54a\uc74c\uc744 \uc774\uc6a9\ud55c \uc2dd \ubcc0\ud658\uc73c\ub85c \ubcfc \uc218 \uc788\uaca0\ub2e4.\\n:::\\n\\n\uacb0\ub860\uc801\uc73c\ub85c, \uc774\ub7ec\ud55c \uacfc\uc815\uc744 \ud1b5\ud574 SWE\ub294 \uc720\ub3c4\ub41c\ub2e4.\\n\\n\uc55e\uc11c, \uc5f0\uc9c1\uc73c\ub85c \uc801\ubd84\uc744 \ud558\uc5ec \uc774\ub7ec\ud55c SWE\ub97c \uc5bb\uc5c8\uae30 \ub54c\ubb38\uc5d0 \ubcf8 \ubc29\uc815\uc2dd\uc5d0\ub294 \uc5f0\uc9c1\ubc29\ud5a5\uc758 \uc720\uc18d \ud56d\uc774 \uc874\uc7ac\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n\\n:::warning\\n\ub2e4\ub9cc, \uadf8\ub807\ub2e4\uace0 \ud558\uc5ec \uc5f0\uc9c1\ubc29\ud5a5\uc73c\ub85c\uc758 \uc720\uc18d\uc774 \ubc18\ub4dc\uc2dc 0\uc774\ub77c\ub294 \uc758\ubbf8\ub294 \uc544\ub2c8\ub2e4.\\n\\n\uc989, \uc774\ub294 \uc911\uc694\ud558\uac8c \uad6c\ubcc4\ud574\uc57c \ud558\ub294\ub370, \uc608\ub97c \ub4e4\uc5b4, \ubc14\ub2e5\uc758 \uae4a\uc774\uac00 \ubcc0\ud55c\ub2e4\uba74 \uc5f0\uc9c1\ubc29\ud5a5\uc758 \uc720\uc18d\uc774 0\uc77c \uc218 \uc5c6\ub2e4.\\n\\n\ubc18\uba74\uc5d0, \uc5f0\uc9c1\ubc29\ud5a5\uc758 \uc720\uc18d\uc774 0\uc774\ub77c\uba74, \uc774\ub54c\ub294 \ubc14\ub2e5\uc758 \uae4a\uc774\uac00 \uc77c\uc815\ud558\uc5ec \ud3c9\ud3c9\ud55c \ubc14\ub2e5\uc77c \uac83\uc774\ub2e4.\\n\\n\uacb0\ub860\uc801\uc73c\ub85c, \uc5f0\uc9c1\ubc29\ud5a5\uc758 \uc720\uc18d\uc774 0\uc77c \ub54c\ub294 SWE\uc0c1\uc5d0\uc11c\uc758 \ubc14\ub2e5\uc740 \uadf8 \uae4a\uc774\uac00 \uc77c\uc815\ud55c \ud3c9\ud3c9\ud55c \ubc14\ub2e5\uc774\ub2e4.\\n:::\\n\\n\uc77c\ub2e8 \ud558\ub098\uc758 \uc194\ub8e8\uc158(\uc218\ud3c9\ubc29\ud5a5\uc73c\ub85c\uc758 \uc720\uc18d\uacfc \uc790\uc720\uc218\uba74\uc758 \ubcc0\uc704)\uc774 \ucc3e\uc544\uc9c4\ub2e4\uba74, \uc5f0\uc9c1\ubc29\ud5a5\uc73c\ub85c\uc758 \uc720\uc18d\uc740 \uc5f0\uc18d\ubc29\uc815\uc2dd\uc744 \ud1b5\ud574 \ubcf5\uad6c\ub420 \uc218 \uc788\ub2e4.\\n\\n:::success\\n\uc720\uccb4 \ub3d9\uc5ed\ud559\uc5d0\uc11c\ub294 \uc218\ud3c9\ubc29\ud5a5\uc73c\ub85c\uc758 \uae38\uc774 \uc2a4\ucf00\uc77c\uc774 \uc5f0\uc9c1\ubc29\ud5a5\uc73c\ub85c\uc758 \uae38\uc774 \uc2a4\ucf00\uc77c\uc5d0 \ube44\ud574 \ud6e8\uc52c \ub354 \ud070 \uac83\uc774 \uc77c\ubc18\uc801\uc774\uae30 \ub54c\ubb38\uc5d0 \uc774\ub7ec\ud55c SWE\uac00 \ub110\ub9ac \uc801\uc6a9\ub420 \uc218 \uc788\ub2e4.\\n:::\\n\\n:::warning\\nSWE \ubaa8\ub378\uc740 \uc624\uc9c1 \ud558\ub098\uc758 \uc5f0\uc9c1 Level\ub9cc\uc744 \uac00\uc9c0\uae30 \ub54c\ubb38\uc5d0 \ub192\uc774\uc5d0 \ub530\ub77c \ub2ec\ub77c\uc9c0\ub294 \ubaa8\ub4e0 \uc694\uc18c\ub97c \uc9c1\uc811\uc801\uc73c\ub85c \ucd1d \ub9dd\ub77c\ud560 \uc218\ub294 \uc5c6\ub2e4.\\n\\n\uadf8\ub7ec\ub098, \ud3c9\uade0\uc0c1\ud0dc\uac00 \ucda9\ubd84\ud558\uac8c \ub2e8\uc21c\ud55c \uacbd\uc6b0\uc5d0 SWE\uc5d0\uc11c \uc218\ud3c9\ubc29\ud5a5\uc758 \uba87\uba87\uc758 \uc9d1\ud569\ub4e4\ub85c\ubd80\ud130 \ubd84\ub9ac\ub418\uc5b4\uc9c8 \uc218 \uc788\ub294 \uc5f0\uc9c1\ubc29\ud5a5\uc73c\ub85c\uc758 \ubcc0\ud615\uc774 \uadf8 \uc0c1\ud0dc\ub97c \uc124\uba85\ud560 \uc218 \uc788\ub2e4.\\n:::\\n\\n# Equations\\n\\n## Conservative Form\\n\\nSWE\ub294 \uc9c8\ub7c9\ubcf4\uc874\uacfc \uc120\ud615 \ubaa8\uba58\ud140 \ubcf4\uc874\uc5d0 \ub300\ud55c \ubc29\uc815\uc2dd(Navier-Stokes Equations)\ub4e4\ub85c\ubd80\ud130 \uc720\ub3c4\ub418\uc5b4\uc9c0\ub294\ub370, \uc2ec\uc9c0\uc5b4 Shallow-Water\uc758 \uac00\uc815\uc774 \uae68\uc9c0\ub294 \ub3c4\uc218 \ud604\uc0c1\uc5d0\uc11c\ub3c4 \uc131\ub9bd\ud55c\ub2e4.\\n\\n\uc218\ud3c9\ud558\uc0c1(\ubc14\ub2e5\uc774 \uc218\ud3c9)\uc778 \uacbd\uc6b0\uc5d0 Coriolis, \ub9c8\ucc30\uacfc \uc810\uc131\ub825 \ubaa8\ub450\ub97c \ubb34\uc2dc\ud560 \uc218 \uc788\uc73c\ubbc0\ub85c, SWE\ub294 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n\\n$$\\\\frac{\\\\partial{(\\\\rho{\\\\eta})}}{\\\\partial{t}} + \\\\frac{\\\\partial{(\\\\rho{\\\\eta{u}})}}{\\\\partial{x}} + \\\\frac{\\\\partial{(\\\\rho{\\\\eta{v}})}}{\\\\partial{y}} = 0,$$\\n\\n$$\\\\frac{\\\\partial{(\\\\rho{\\\\eta{u}})}}{\\\\partial{t}} + \\\\frac{\\\\partial}{\\\\partial{x}}\\\\left( \\\\rho{\\\\eta{u^{2}}} + \\\\frac{1}{2}{\\\\rho{g}{\\\\eta^{2}}}\\\\right) + \\\\frac{\\\\partial{(\\\\rho{\\\\eta{uv}})}}{\\\\partial{y}} = 0$$\\n\\n$$\\\\frac{\\\\partial{(\\\\rho{\\\\eta{v}})}}{\\\\partial{t}} + \\\\frac{\\\\partial{(\\\\rho{\\\\eta{uv}})}}{\\\\partial{x}} + \\\\frac{\\\\partial}{\\\\partial{y}}\\\\left(\\\\rho{\\\\eta{v^{2}}} + \\\\frac{1}{2}{\\\\rho{g\\\\eta^{2}}}\\\\right) = 0$$\\n\\n\uc5ec\uae30\uc11c $\\\\eta$\ub294 \ucd1d \uc720\uccb4 \uae30\ub465\uc758 \ub192\uc774($$x$$, $$y$$, \uadf8\ub9ac\uace0 $$t$$\uc758 \ud568\uc218\ub85c \ud45c\ud604\ub418\ub294 \uc21c\uac04 \uc720\uccb4\uc758 \uae4a\uc774)\uc774\uace0, 2D \ubca1\ud130 $$(u, v)$$\ub294 \uc720\uccb4\uc758 \uc218\ud3c9\ubc29\ud5a5\uc758 \uc720\uc18d\uc73c\ub85c\uc11c, \uc5f0\uc9c1\uae30\ub465\uc5d0 \uac78\uccd0 \ud3c9\uade0\uc801\uc774\ub2e4.\\n\\n\ub354 \ub098\uc544\uac00 $g$\ub294 \uc911\ub825\uac00\uc18d\ub3c4\uc774\uace0, $\\\\rho$\ub294 \uc720\uccb4\uc758 \ubc00\ub3c4\uc774\ub2e4.\\n\\n\uccab \ubc88\uc9f8 \ubc29\uc815\uc2dd\uc740 \uc9c8\ub7c9 \ubcf4\uc874\uc73c\ub85c\ubd80\ud130 \uc720\ub3c4\ub418\uc5c8\uace0, \ub098\uba38\uc9c0 \ubc29\uc815\uc2dd\ub4e4\uc740 \ubaa8\uba58\ud140 \ubcf4\uc874\uc73c\ub85c\ubd80\ud130 \uc720\ub3c4\ub418\uc5c8\ub2e4. \\n\\n# References\\n\\n[Wikipedia](https://en.wikipedia.org/wiki/Shallow_water_equations)"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-22-welcome/index.md","source":"@site/blog/2022-12-22-welcome/index.md","title":"Welcome","description":"","date":"2022-12-22T00:00:00.000Z","formattedDate":"December 22, 2022","tags":[{"label":"facebook","permalink":"/blog/tags/facebook"},{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0,"hasTruncateMarker":false,"authors":[{"name":"\uc548\uac15\ud604","title":"Team Leader, Undergraduate Student","url":"https://github.com/hee-lab/","imageURL":"/img/profile/agh.jpeg","key":"ankang"},{"name":"\uc548\ub3d9\uaddc","title":"Undergraduate Student","url":"https://github.com/hee-lab/","imageURL":"https://cdn-icons-png.flaticon.com/128/149/149071.png","key":"andong"},{"name":"\uc774\uc6a9\ud638","title":"Undergraduate Student","url":"https://github.com/hee-lab/","imageURL":"https://cdn-icons-png.flaticon.com/128/149/149071.png","key":"leey"},{"name":"\uae40\uc885\ud601","title":"Undergraduate Student","url":"https://enfycius.github.io","imageURL":"https://avatars.githubusercontent.com/u/34566999?v=4","key":"jong"},{"name":"\uc591\uc124\uc544","title":"Undergraduate Student","url":"https://github.com/hee-lab/","imageURL":"https://cdn-icons-png.flaticon.com/128/149/149071.png","key":"yang"},{"name":"\uc774\uc2b9\uc6b1","title":"Undergraduate Student","url":"https://github.com/hee-lab/","imageURL":"/img/profile/lsw.jpeg","key":"lees"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["ankang","andong","leey","jong","yang","lees"],"tags":["facebook","hello","docusaurus"]},"prevItem":{"title":"SWE(Shallow Water Equations)","permalink":"/blog/swe"}},"content":""}]}')}}]);